"Two sets are disjoint if their intersection is the empty set"

P({ {} }) = { {}, {{}} }

Intersection of { {} } and { {}, {{}} } is {}. Should be disjoint?

{{}} not equal to {}. 
If disjoint, intersection = {}
If they have {} in common, intersection is {{}}

it’s quite easy to show they aren’t equal with an example
Let A = {1, 2} and B = {1, 2, 3}
It’s quite clear every element of A is an element of B thus A is a subset of B however the set {1, 2} is clearly not an element of B
